        public async Task Send2Excel()
        {
			IEnumerable<EntryDataDetail> lst = null;
            using (var ctx = new EntryDataDetailRepository())
            {
                lst = await ctx.GetEntryDataDetailsByExpressionNav(vloader.FilterExpression, vloader.NavigationExpression).ConfigureAwait(continueOnCapturedContext: false);
            }
             if (lst == null || !lst.Any()) 
              {
                   MessageBox.Show("No Data to Send to Excel");
                   return;
               }
            var s = new ExportToCSV<EntryDataDetailExcelLine, List<EntryDataDetailExcelLine>>
            {
                dataToPrint = lst.Select(x => new EntryDataDetailExcelLine
                {
 
                    EntryDataId = x.EntryDataId ,
                    
 
                    LineNumber = x.LineNumber ,
                    
 
                    ItemNumber = x.ItemNumber ,
                    
 
                    Quantity = x.Quantity ,
                    
 
                    Units = x.Units ,
                    
 
                    ItemDescription = x.ItemDescription ,
                    
 
                    Cost = x.Cost ,
                    
 
                    QtyAllocated = x.QtyAllocated ,
                    
 
                    UnitWeight = x.UnitWeight ,
                    
 
                    DoNotAllocate = x.DoNotAllocate ,
                    
 
                    Freight = x.Freight ,
                    
 
                    Weight = x.Weight ,
                    
 
                    InternalFreight = x.InternalFreight ,
                    
 
                    Status = x.Status ,
                    
 
                    InvoiceQty = x.InvoiceQty ,
                    
 
                    ReceivedQty = x.ReceivedQty ,
                    
 
                    PreviousInvoiceNumber = x.PreviousInvoiceNumber ,
                    
 
                    CNumber = x.CNumber ,
                    
 
                    Comment = x.Comment ,
                    
 
                    EffectiveDate = x.EffectiveDate ,
                    
 
                    IsReconciled = x.IsReconciled ,
                    
 
                    TaxAmount = x.TaxAmount ,
                    
 
                    LastCost = x.LastCost 
                    
                }).ToList()
            };
            using (var sta = new StaTaskScheduler(numberOfThreads: 1))
            {
               await Task.Factory.StartNew(s.GenerateReport, CancellationToken.None, TaskCreationOptions.None, sta).ConfigureAwait(false);
            }
